import React from 'react';
import TodoTemplate from './Components/TodoTemplate';
import TodoInsert from './Components/TodoInsert';
import TodoListItem from './Components/TodoListItem';

const App = () => {
  return (
    <TodoTemplate>
      <TodoInsert />
      <TodoListItem />
    </TodoTemplate>
  );
};

export default App;
